import React from 'react'

const UserList = () => {
  const { isLoading, error, data } = useQuery({
    queryKey: ['userList'],
    queryFn : USER_API.users
  });

  if (isLoading) return 'Loading...';

  if (error) return 'Error: ' + error.message;
  return (
    <div>UserList</div>
  )
}

export default UserList
